import React from "react";

class MiLista extends React.Component {
    incidencias=["Proyecto averiado en el aula 2", "Ordenador no enciende", "Impresora sin conexion","Wifi no disponible", "Pantalla tactil no responde"]
    render(){
    return(
        <div ClassName='lista'>
          <ul>
            {
                this.incidencias((i)=>(
                    <li>{i}</li>
                ))
            }
          </ul>
        </div>
    );
}
}
export default MiLista;
